                        <img className="BackIcon" src={BackIcon} alt="Back" />
                    </Col>
                    <Col xs={3}>
                        <img className="HomeIcon" src={HomeIcon} alt="Home" />
                    </Col>
                    <Col xs={3}>

                    </Col>
                </Row>
            </div>
        )
    }
}

export default Footer
